import { Route, } from "react-router-dom";
import Home from "./components/Home";
function App(){
    return(
        <div>
            <Routes>
                <Route path="/" element={<Home/>} />
                <Route path="/about" element={<div>about me</div>}/>
            </Routes>
        </div>
    );
}
export default App;
